import React from 'react';
import AppLayout from "../components/AppLayout";
import Head from 'next/head';
const JavaScript = () => {
    return (
        <>
            <Head>
                <title>JavaScript</title>
            </Head>
            <AppLayout>
                <div>자바스크립트페이지입니다</div>
            </AppLayout>
        </>
    );
}

export default JavaScript;
